import React, { useState } from "react";
import CardComp from "../card/card";
import axios from "axios";
import "./style.css";
const [item, setItem] = useState();
const { title, subtitle, options, description } = item;

export default function Cards() {
  const titles = ["Boots", "T-Shirt", "Jeans", "Hat", "Jacket"];
  const getItems = async () => {
    const { items } = await axios.get("http://localhost:8001/getItemList", {
      title,
      subtitle,
      options,
      description,
    });
  };

  return (
    <div className="card_wappper">
      <div className="cards">
        {titles.map((title, index) => (
          <CardComp title={title} />
        ))}
      </div>
    </div>
  );
}
